var e="Husk of Opulent Dreams",t=["4","5"],a={name:"Bloom Times",relictype:"Flower of Life",description:"A small golden ornament with six petals that shall never wilt. It symbolizes the transience of mortal glories."},o={name:"Plume of Luxury",relictype:"Plume of Death",description:"A feather-shaped token that was brought forth from a secluded hall. The compassion of its creator led to it being left within that mansion along with a certain slumbering form."},i={name:"Song of Life",relictype:"Sands of Eon",description:"As far as Inazuma is concerned, this is some small object from overseas. The heart of this mechanism has been removed, and its hands no longer turn."},n={name:"Calabash of Awakening",relictype:"Goblet of Eonothem",description:"A gourd that has been adorned with powdered gold and black paint. Its original color can no longer be discerned, but its main use seems to be as a performance prop."},s={name:"Skeletal Hat",relictype:"Circlet of Logos",description:"A hat that once shielded a wanderer from sun and rain. It eventually became a convenient tool with which faces might be hidden and expressions obscured."},r={name:e,rarity:t,"2pc":"DEF +30%","4pc":"A character equipped with this Artifact set will obtain the Curiosity effect in the following conditions: When on the field, the character gains 1 stack after hitting an opponent with a Geo attack, triggering a maximum of once every 0.3s. When off the field, the character gains 1 stack every 3s. Curiosity can stack up to 4 times, each providing 6% DEF and a 6% Geo DMG Bonus. When 6 seconds pass without gaining a Curiosity stack, 1 stack is lost.",flower:a,plume:o,sands:i,goblet:n,circlet:s};export{s as circlet,r as default,a as flower,n as goblet,e as name,o as plume,t as rarity,i as sands};
